INSERT INTO `articles` VALUES (1,'NUS - SCS Dialogue Session','<p style=\"margin: 0px 0px 6px; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">We will be jointly organising, with Student Computer Society (SCS), a dialogue session on having a career in Quality Assurance (QA)!</p>\r\n\r\n<p style=\"margin: 6px 0px; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">The session will be held on the <strong>21st of August, 1.45pm - 4pm</strong>, at Cerebro!</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">Sign up through the link in the accompanying image if you are interested!</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\"><br />\r\n&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\"><span style=\"font-size:10px;\"><img alt=\"\" src=\"https://scontent.xx.fbcdn.net/hphotos-xpt1/t31.0-8/11888535_842770989124453_7264938367059841081_o.jpg\" style=\"width: 600px; height: 424px;\" /></span></p>\r\n','2015-08-16 17:54:40','2015-08-17 04:53:34'),(2,'18th Management Committee General Elections','<p style=\"margin: 0px 0px 6px; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">18th Management Committee General Elections voting period starts today! Voting will be held from 10am - 6pm from Wednesday, 26th Aug to Friday, 28th Aug this week!</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">Do come down to vote for the nominees you wish to see leading our Club for the year ahead! You can view the list of nominees and their manifestos at&nbsp;<a href=\"http://nuscomputing.com/election\" rel=\"nofollow\" style=\"color: rgb(59, 89, 152); cursor: pointer; text-decoration: none;\" target=\"_blank\">http://nuscomputing.com/election</a></p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px;\">&nbsp;</p>\r\n\r\n<p style=\"margin: 6px 0px 0px; display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 14px; line-height: 12.8800001144409px; text-align: center;\"><img alt=\"18th Management Committee General Elections\" src=\"/ckeditor_assets/pictures/1/content_11892365_847145582020327_319157976165551852_o.jpg\" style=\"height: 848px; width: 600px;\" /></p>\r\n','2015-08-26 19:40:42','2015-08-26 19:40:51'),(3,'18th Management Committee By-Election','<p><span style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\">18th Management Committee By-Election has begun!&nbsp;</span><br style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\" />\r\n<br style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\" />\r\n<span style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\">Here are the important dates to take note of</span><br style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\" />\r\n<span style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\">3 - 4 Sept: Nominations outside Club room &amp; Student Lounge</span><br style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\" />\r\n<span style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\">7 Sept: Nominees&#39; Interviews</span><br />\r\n<span class=\"text_exposed_show\" style=\"display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\">8 - 10 Sept: Nominees&#39; Campaigning<br />\r\n9 - 10 Sept: Polling (10am - 6pm at Student Lounge)</span></p>\r\n\r\n<p><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\">Check out&nbsp;</span><span style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\">&nbsp;</span><a href=\"http://nuscomputing.com/election\" rel=\"nofollow nofollow\" style=\"color: rgb(59, 89, 152); cursor: pointer; text-decoration: none; font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\" target=\"_blank\">http://nuscomputing.com/<wbr />election</a><span style=\"color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\">&nbsp;for more information!</span></p>\r\n\r\n<p><span class=\"text_exposed_show\" style=\"display: inline; color: rgb(20, 24, 35); font-family: helvetica, arial, sans-serif; font-size: 12px; line-height: 10.72px;\"><img alt=\"18th MC By-Election\" src=\"/ckeditor_assets/pictures/2/content_11894193_850647708336781_2306900859850415736_o.jpg\" style=\"width: 800px; height: 1132px;\" /></span></p>\r\n','2015-09-03 17:10:20','2015-09-03 17:10:20');
