INSERT INTO `feedbacks` VALUES (1,'Hi','Hello. I like the new appearance of the site! :)','','2015-08-16 18:11:20','2015-08-16 18:11:20'),(2,'17th MC Page','Hello,\r\n\r\nFeedback from Prof Gary, can we have back the nuscomputing.com/17mc page please?\r\n\r\nBasically he wants a way to be able to see the faces of the 17th MC.\r\n\r\nAs long as can have pictures of the current MC members, to show that we\'re still in office is good enough for him.','vp.ops@nuscomputing.com','2015-08-18 09:01:57','2015-08-18 09:01:57'),(3,'~','nuscomputing.com/mc17','','2015-08-18 19:58:05','2015-08-18 19:58:05'),(4,'Locker cannot close','Good morning,\r\n\r\nI am allocated Locker 2017 of Area G, but I cannot close my locker. The lock hole on the locker side is not aligned with the hole on the door side, and I can\'t seem to push the lock hole upwards to fix the locker with brute force. May I know what I should do? Some other lockers around mine face the same problem too.','jiayeerawr@gmail.com','2015-08-20 03:04:24','2015-08-20 03:04:24'),(5,'Locker Paddlocked','Hi,\r\n\r\nI just made a check on my allocated locker 2035 (G), however it seems that it is padlocked. I believe its being used by someone else. \r\n\r\nPlease advice on how I should go about this issues. \r\n\r\nThank you! :)','e0003893@u.nus.edu','2015-08-20 08:23:05','2015-08-20 08:23:05'),(6,'Invitation to lecture on data privacy','Hi,\r\n\r\nI hope this email finds you well. I am Sherrie from the University Events team at Singapore Management University. \r\n\r\nWe would like to extend a special invitation to the NUS Computing Club to attend an upcoming public lecture by data privacy expert Prof Alessandro Acquisti on Tuesday 15 September 2015, 5.00pm â€“ 6.30pm. Prof Acquisti will be speaking on the topic of data privacy and its implications on businesses and society. We feel that this may be of interest to you, and would like to request for your help in extending this invitation to the NUS Computing students.\r\n\r\nMore details on the event are available at http://www.smu.edu.sg/pdls/speaker. Please feel free to contact me if you have any queries.\r\n\r\nThank you, and we look forward to hearing from you.\r\n\r\nBest regards,\r\nSherrie Loe\r\nAssistant Manager, University Events\r\nOffice of Corporate Communications and Marketing\r\nTel: +65 6808 7937','sherrieloe@smu.edu.sg','2015-09-04 06:53:16','2015-09-04 06:53:16'),(7,'Part Time Job Opportunities in November 2015 Holidays','Dear Sir/Madam, I represent Kidz Coding Lab, an IT training provider for young children. We will be conducting a 3-day holiday bootcamp from 18 to 20 Nov at Suntec for 6 to 8 year-olds, and require some part-time assistants.\r\n\r\nPlease feel free to forward this to your members, and you can reach out to me for further details.\r\n\r\nThank you.\r\n\r\nRegards,\r\nGerard Koh\r\n','gerard@kidzcodinglab.com.sg','2015-09-10 06:38:17','2015-09-10 06:38:17'),(8,'Find out more about subcommittee','Hello. I am interested in joining the subcommittee but I need to find out more about each and every committee before being sure of which ones to express more interest in in the recruitment form. I could not find information on the web.','e0005572@u.nus.edu','2015-09-14 03:39:57','2015-09-14 03:39:57'),(9,'Hi','Hello','','2015-09-14 10:59:01','2015-09-14 10:59:01');
